// src/pages/patients/PatientList.jsx
import React, { useEffect, useState } from 'react';
import { Container, Typography, Table, TableBody, TableCell, TableHead, TableRow, Paper, Dialog, DialogActions, DialogContent, DialogTitle, Button } from '@mui/material';
import { styled } from '@mui/system';
import { useNavigate } from 'react-router-dom';
import { useAuth } from '../../contexts/AuthContext';
import HamburgerMenu from '../../components/HamburgerMenu';

const Root = styled('div')({
  display: 'flex',
  justifyContent: 'center',
  alignItems: 'center',
  height: '100vh',
  backgroundColor: '#f5f5f5',
});

const StyledTable = styled(Table)({
  minWidth: 650,
});

const Header = styled('div')({
  display: 'flex',
  justifyContent: 'space-between',
  alignItems: 'center',
  width: '100%',
  marginBottom: 16,
});

function PatientList() {
  const [patients, setPatients] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [open, setOpen] = useState(true); // Modal aperta di default
  const navigate = useNavigate();
  const { user } = useAuth();

  useEffect(() => {
    const fetchPatients = async () => {
      try {
        const response = await fetch('http://localhost:5000/api/patients');
        if (!response.ok) {
          throw new Error('Network response was not ok');
        }
        const data = await response.json();
        console.log(data); // Aggiungi un log per vedere i dati ricevuti
        setPatients(data);
      } catch (error) {
        setError(error.message);
      } finally {
        setLoading(false);
      }
    };
    fetchPatients();
  }, []);

  const handleClose = () => {
    setOpen(false);
    navigate('/main'); // Torna alla pagina principale quando la modal viene chiusa
  };

  if (loading) {
    return <Root><Typography>Loading...</Typography></Root>;
  }

  if (error) {
    return <Root><Typography>Error: {error}</Typography></Root>;
  }

  return (
    <div>
      <HamburgerMenu />
      <Dialog fullScreen open={open} onClose={handleClose}>
        <DialogTitle>Patient List</DialogTitle>
        <DialogContent>
          <Container component={Paper} style={{ padding: 16 }}>
            <Header>
              <Typography variant="h4" component="h1" gutterBottom>
                Patient List
              </Typography>
            </Header>
            <StyledTable>
              <TableHead>
                <TableRow>
                  <TableCell>Nominativo</TableCell>
                  <TableCell>Et√†</TableCell>
                  <TableCell>Altezza</TableCell>
                  <TableCell>Peso</TableCell>
                  {user.isadmin && <TableCell>Dottore</TableCell>}
                </TableRow>
              </TableHead>
              <TableBody>
                {patients.map((patient) => (
                  <TableRow key={patient.uuid}> {/* Usa l'UUID come chiave */}
                    <TableCell>{patient.nominativo}</TableCell>
                    <TableCell>{patient.eta}</TableCell>
                    <TableCell>{patient.altezza}</TableCell>
                    <TableCell>{patient.peso}</TableCell>
                    {user.isadmin && <TableCell>{patient.doctorid}</TableCell>}
                  </TableRow>
                ))}
              </TableBody>
            </StyledTable>
          </Container>
        </DialogContent>
        <DialogActions>
          <Button onClick={handleClose} color="primary">
            Indietro
          </Button>
        </DialogActions>
      </Dialog>
    </div>
  );
}

export default PatientList;
